import 'bootstrap/dist/css/bootstrap.min.css';
import './SignIn.css';

function SignIn() {
    return (
        <div className="SignIn container-fluid">
            <div className="row">
                <div className="col-6 Illustration"></div>
                <div className="col-6 signInForm"></div>
            </div>
        </div>
    );
  }

  export default SignIn;
